import React, { Component } from 'react';
import './Keyboard.css';

class Keyboard extends Component {
	render(){
		const onClick = e => {
			nombreAction(e.target.value);
		}
		return(
			<table className="tableKeyboard">
		<tr>
			<button onClick={onClick}>1</button>
			<button onClick={onClick}>2</button>
			<button onClick={onClick}>3</button>
		</tr>
		<tr>
			<button defaultValue="4">4</button>
			<button defaultValue="5">5</button>
			<button defaultValue="6">6</button>
		</tr>
		<tr>
			<button defaultValue="7">7</button>
			<button defaultValue="8">8</button>
			<button defaultValue="9">9</button>
		</tr>
		<tr id="buttonRow">
			<button className="buttonClear">Delete</button>
		</tr>
	</table>
		);
	}
}

export default Keyboard;
